D4_94cc2a04ad62289c5b91357e2c4ef4964b064c3ae780c9bd542f695c61022d04 = "ADP is hiring a Fullstack Angular Developer with demonstrated experience in Angular, Javascrpt, and Java8. Does this sound like you? We believe people make great companies, not the other way around. Our people make all the difference in delivering innovative HR technologies and solutions that help employees all over the world do their jobs better. The result? We're building the next generation of ADP technologies. Join ADP's innovation lab as we undertake one of ADP's most ambitious transformation initiatives ever. We're building a team from of the most elite, game-changing technologists and asking them to reinvent the way millions of employees are paid worldwide. If you are a sharp, self-driven product manager who is passionate about solving really big problems, we want to talk to you. Job Description The Lead Application Developer -- UI is responsible for developing software solutions for ADP's external and internal clients. Will be involved in all aspects of the agile software development life cycle. Will work under guidance with other members of scrum team to design, develop and test solutions consistent with the business objectives. Lead Application Developers at ADP are expected to be results-oriented, learn new and legacy technologies, have knowledge of the relevant platforms and environments, and be familiar with business process, functions and data to provide innovative, insightful, and secure user interface. Responsibilities: Design, coding and testing Angular based application independently Participate in agile development activities including SBE (specification-by-example) for requirements and event-storming session Creating and consuming REST, JSON-based API Work with product owners, UX and other business partners to define best user experience Perform code reviews, test automation, end-to-end testing etc. and other duties as required Experiment with new technologies and innovative ways to solve problem Lead development team to deliver in the CI / CD way with test-driven development mindset QUALIFICATIONS: Bachelor's or Master's degree in Computer Science, Software Engineering, HCI or similar 8 years of software development experience Angular, React, Backbone or other client-side MVC experience Experience with JavaScript build tools and dependency management (npm, bower, grunt, gulp) 5 years of HTML, CSS, and JavaScript experience Experience in creating responsive designs (Bootstrap, mobile, etc.) Experience with unit and automation testing (Jasmine, Protractor, JUnit) Experience with Java 8 and Spring ecosystem Knowledge of Java build tools and dependency management (gradle, maven) REST API design and implementation Experience in relational database such as MySQL, PostgreSQL, or Oracle. Strong collaboration and communications skills, i.e., work well in an open-seating team environment. PREFERRED QUALIFICATIONS: Knowledge of web components, ES6 and typescript. Experience with CSS preprocessors (less, sass) Knowledge of Domain Driven Design concepts and microservices Knowledge of virtualization approaches such as docker containers Knowledge of event sourcing and distributed message systems such as Amazon SNS #LITECH #LI-AA2 We're designing a better way to work, so you can achieve what you're working for. Consistently named one of the 'Most Admired Companies' by FORTUNE® Magazine, and recognized by DiversityInc® as one of the 'Top 50 Companies for Diversity,' ADP works with more than 740,000 organizations across the globe to help their people work smarter, embrace new challenges, and unleash their talent. \"Always Designing for People\" means we're creating platforms that will transform how great work gets done, so together we can unlock a world of opportunity. At ADP, we believe that diversity fuels innovation. ADP is committed to equal employment opportunities regardless of race, color, genetic information, creed, religion, sex, sexual orientation, gender identity, lawful alien status, national origin, age, marital status, or protected veteran status. We support an inclusive workplace where associates excel based on personal merit, qualifications, experience, ability, and job performance."
D5_b38ba1e9410d66ad5d319c95830df8a0b95f8f1c99fc0379eac64d23b76e2c5f = "Description Job Description: The Systems for Inspections, Recalls, Compliance Enforcement (SIRCE) and Imports program supports the Food and Drug Administration (FDA) Office of Regulatory Affairs' (ORA) critical work to safeguard the foods, drugs, devices, biologics, and veterinary products that the Agency regulates. These systems continue to evolve to meet emerging business needs and to support new mandates and initiatives. It is important to respond to customer needs and issues. The Offline Developer position supports the eNSpect development team in developing a Software solution for offline inspections for field agents. Specific roles & responsibilities for the .NET and WPF Offline SW Development position include but not limited to the following: Development of Offline code using .NET and WPF Responding to defects from production system Performing code inspections Collaboration with the Business Analysts, test team and leads Documentation for customer deliverables Update of assigned tasks in ALM Ability to very quickly ramp up to understand code, provide updates, design inputs, interfaces to other applications within the eNSpect solution (Online and Oracle DB interfaces) BS degree and 2 - 4 years of prior relevant experience or Masters with less than 2 years of prior relevant experience Minimum Qualifications Min least 2-5 years .NET experience and programming with C# Min least 1 year working experience with .Net WPF and associated Design Patterns Experience working with Entity Framework, LINQ Experience building Windows Standalone applications with personal database servers Experience working with Oracle or any other RDBMS, writing and executing SQL Queries, Experience working in an Agile Work Environment and knowledge of scrums and sprints Agile development experience Code inspection experience Strong verbal and written communications skills Ability to clearly articulate key technical concepts and ideas. Ability to work well in a team environment spanning multiple locations. Ability to work independently and with a team Desired skills: Word Automation, Oracle Policy Modeling or experience or other Rules Engines , SQL Anywhere Mobilink server experience or knowledge Working knowledge of ALM (workload tracking) Working knowledge of JIRA (production ticket system) # Years' experience - 2-5 Years SW Development experience in .NET HHSFDA External Referral Bonus: Ineligible Potential for Telework: No Clearance Level Required: Public Trust Travel: No Scheduled Weekly Hours: 40 Shift: Day Requisition Category: Professional Job Family: Software Development Leidos is a Fortune 500® information technology, engineering, and science solutions and services leader working to solve the world's toughest challenges in the defense, intelligence, homeland security, civil, and health markets. The company's 33,000 employees support vital missions for government and commercial customers. Headquartered in Reston, Virginia, Leidos reported annual revenues of approximately $10.19 billion for the fiscal year ended December 28, 2018. For more information, visit www.Leidos.com . Pay and benefits are fundamental to any career decision. That's why we craft compensation packages that reflect the importance of the work we do for our customers. Employment benefits include competitive compensation, Health and Wellness programs, Income Protection, Paid Leave and Retirement. More details are available here . Leidos will never ask you to provide payment-related information at any part of the employment application process. And Leidos will communicate with you only through emails that are sent from a Leidos.com email address. If you receive an email purporting to be from Leidos that asks for payment-related information or any other personal information, please report the email to spam.leidos@leidos.com . All qualified applicants will receive consideration for employment without regard to sex, race, ethnicity, age, national origin, citizenship, religion, physical or mental disability, medical condition, genetic information, pregnancy, family structure, marital status, ancestry, domestic partner status, sexual orientation, gender identity or expression, veteran or military status, or any other basis prohibited by law. Leidos will also consider for employment qualified applicants with criminal histories consistent with relevant laws."
D6_e39e9acedbeee1989286214de6376e6add12920bb71aa216ec9a0d152418cab3 = "Description: The Hartford is looking for an innovative Software Engineer / Java Developer to join our Middle and Large Commercial organization in either Hartford, CT or Charlotte, NC. You'd be joining a fast-paced agile organization that utilizes the latest web technologies to deliver great products! This forward looking and collaborative team presents the opportunity for you to grow your career and be part of the future growth of our Business! Our technology stack Angular 6+ Lightweight modern Java, Restful APIs Contemporary DevOps pipeline\\: Github, Jenkins, Nexus, Docker Containers What's in it for you? Experience working in a fast paced environment - driving business outcomes leveraging Agile to its fullest Career growth and opportunity to grow into a hands-on leadership role Supporting environment that fosters can-do attitude and opportunity for growth and advancement based on consistent demonstrative performanceAbility to utilize your analytical, problem solving, and interpersonal skills Delivering verbal and written communication to all levels of the organization.Work with a team of talented software engineers and analysts to implement key capabilities on our architectural roadmap in support of our business strategy. Opportunity to expand your technical, communication, analytical, interpersonal, and organization capabilities Qualification: Bachelors degree in Computer Science or related disciple with a minimum of 4+ years of work 4+ years hands on development experience with CSS/SASS, JavaScript or TypeScript Requires understanding & usage of Java technologies and Restful web services Strong understanding of OOPS concepts and ability to develop detailed application designs using proven industry patterns and best practices Thorough understanding and experience using relational databases / SQL Superior organization skills with the ability to simultaneously handle multiple projects and priorities in a fast-paced environment What Else Can You Tell Me? The Hartford is committed to the education and growth of our Information Technology Professionals. A number of IT Certifications are available to enhance your career and growth potential. IT Professionals at The Hartford may qualify for a stipend up to $1000 per year for additional certifications Equal Opportunity Employer/Females/Minorities/Veterans/Disability/Sexual Orientation/Gender Identity or Expression/Religion/Age"
D7_4b88acb756e278709f5446e812c07372d980cba57c430bc8bb7845d2889b0a4c = "Business Group Highlights Intelligence The Intelligence group provides high-end systems engineering and integration products and services, data analytics and software development to national and military intelligence customers. Serving federal agencies and the Intelligence Community for more than 50 years, the Intelligence group helps our clients meet their mission needs by providing trusted advisors, leading-edge technologies, and innovative solutions. Responsibilities The Software Engineer Level 1 shall have the following responsibilities: Design, develop, debug and test complex technical applications. Develop new and existing software tools and techniques. Work with a team of developers to meet customer requirements and deadlines. Develop Android and x86 applications. Conduct various testing activities and work with test engineers to help ensure quality control of system components. If you want to be a part of a team of great developers and engineers, this is the position for you. You will be a technology professional adding value to a team where teamwork and collaboration are encouraged! Qualifications Qualifications: Seven (7) years experience as a Software Engineer with experience in application development. C++, with experience in multi-threading in the Linux environment. Strong object-oriented design/programming. 11 protocol/specification analysis General network protocol/stack analysis (IPv4, IPv6, TCP/DP, routing, etc), understanding of OSI layers and their function Understanding of version control systems (git, svn) Experience with cross-compilers, embedded systems, using JTAG is a plus Experience with C, Linux driver model, driver development is a plus Experience with cellular stack (GSM, 2G, 3G, LTE) a plus Experience with database design, SQL optimization / stored procedures is a plus Experience with Assembly (ARM, System V x86) is a plus Experience with parallelization frameworks OpenMP / MPI / CUDA is a plus Education Bachelor's degree in Computer Science or related discipline from an accredited college or university is required. Bachelor's degree may be substituted with four (4) additional years Software Engineer experience on projects with similar scope. CLEARANCE- TS/SCI W POLY About Perspecta What matters to our nation, is what matters to us. At Perspecta, everything we do, from conducting innovative research to cultivating strong relationships, supports one imperative: ensuring that your work succeeds. Our company was formed to bring a broad array of capabilities to all parts of the public sector-from investigative services and IT strategy to systems work and next-generation engineering. Our promise is simple: never stop solving our nation's most complex challenges. And with a workforce of approximately 14,000, more than 48 percent of which is cleared, we have been trusted to just that, as a partner of choice across the entire sector. Perspecta is an AA/EEO Employer - Minorities/Women/Veterans/Disabled and other protected categories. Options Apply for this job onlineApply Share Email this job to a friendRefer Sorry the Share function is not working properly at this moment. Please refresh the page and try again later. Share on your newsfeed As a government contractor, Perspecta abides by the following provision PAY TRANSPARENCY NONDISCRIMINATION PROVISION The contractor will not discharge or in any other manner discriminate against employees or applicants because they have inquired about, discussed, or disclosed their own pay or the pay of another employee or applicant. However, employees who have access to the compensation information of other employees or applicants as a part of their essential job functions cannot disclose the pay of other employees or applicants to individuals who do not otherwise have access to compensation information, unless the disclosure is (a) in response to a formal complaint or charge, (b) in furtherance of an investigation, proceeding, hearing, or action, including an investigation conducted by the employer, or (c) consistent with the contractor's legal duty to furnish information. 41 CFR 60-1.35(c)"
D8_776b7037ae44e192c68d5376b89a60cc43ad66098b3335aa39ff909cd78613cb = "Full-stack Software Engineer - 55998 We are seeking an experienced and motivated Full-stack Software Engineer to join our Enterprise Business Systems Team. This group is responsible for developing and implementing business applications worldwide, including internal and external facing applications such as Financials, CRM, Human Resources, Project Management, among other mission-critical processes. The successful candidate will be comfortable working with various web technologies for both server-side and front-end development, as well as possess keen interest in extending the functionalities to mobile platforms. The nature of this job makes it a highly visible position throughout the enterprise, while contributing significantly towards continuous enhancements in business processes. We are a publicly traded company, a leading provider of simulation/optimization software for product design, high-performance computing, analytics and IoT solutions. Founded in 1985, our technology is used in markets around the world and have more than 5,000 clients across all major industries. Responsibilities: Work in a highly dynamic team to deliver end-to-end solutions for business processes, using web technologies, databases and server platforms. Design and develop high quality, scalable, robust and reusable code and components. Deliver solutions that perform seamlessly across different web browsers and mobile platforms. Work closely with the architect and other developers on software architecture, design, dependencies and code maintainability. Support and maintain existing and new applications, and communicate with stakeholders. Provide technical expertise in using efficient technologies, methodologies and design guidelines. Skills: 1-4 years of experience in full stack software development. Development experience in languages such as Python, Java, Perl, PHP, C++. Working knowledge of database technologies, SQL queries. Experience working with HTML, CSS, JavaScript. Experience using JavaScript libraries like JQuery, ExtJS, React or AngularJS. Knowledge in Agile methodologies is a plus. Experience with REST, SOAP and SOA is a plus. Qualifications: Bachelor's in Computer Science, or equivalent. Ability to work as a single contributor as well as team player. Strong problem-solving and analytical skills. At Fast Switch, Our Purpose is Our People and Our Planet . We come to work each day and are reminded we are helping people find their success stories . Isn't that cool? Also, Doing the right thing is our mantra . We act responsibly, give back to the communities we serve, and have a little fun along the way. We at Fast Switch have been doing this for 22 years . We're doing business in almost half the states in the union with offices in Detroit, MI, Columbus, OH, New York, Hartford, CT, Massachusetts, Minneapolis, MN, Los Angeles, CA, San Francisco, CA, and Tucson, AZ. We're a financially strong, privately-held company that is 100% consultant and client focused . We've differentiated ourselves by being fast, flexible, creative and honest . Throw out everything you've heard, seen, or felt about every other IT Consulting company. We do unique things, and we do them for Fortune 10 companies, Inc. 500 companies, and technology start-ups. We also have a strong belief in giving back to the communities we serve. Our benefits are second to none and thanks to our flexible benefits options you can choose just the benefits that you need or want, options include: * Medical and Dental (Fast Switch pays majority of the medical program) * Vision * Personal Time Off (PTO) Program * Long Term Disability (100% paid) * Life Insurance (100% paid) * 401(k) with immediate vesting and 3% (of salary) dollar-for-dollar match Plus, we have a lucrative employee referral program and an employee recognition culture. In 2013, 2014, 2015, 2016, 2017, 2018 , and 2019 Fast Switch was named one of the Top Work Places in Michigan by the Detroit Free Press and one of the Best Staffing Firms in 2016 and 2017 . We have won the Columbus Business First \"Fast 50\" award 9 times in 12 years because of our strong growth which translates into more and better opportunities for our consulting staff members. Ranked \"#1\" supplier by over 50% of our customers nationally. Ranked \"Top 3\" supplier by over 75% of our customers nationally. To view all of our open positions, please go to: www.fastswitch.com and at the bottom of the page click Job Portal, or get there directly at: https://www.jobs.net/jobs/fastswitch/en-us/all-jobs/ You can also follow us on Twitter at: www.twitter.com/fastswitch And you can become a fan of Fast Switch on Facebook at: http://tinyurl.com/y9y3gdp"
